webpackJsonp([0x887a27fd63a8],{8596:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"My New Favorite Oktoberfest Quote",date:"23 Sep 2009",slug:"/2009-09-23-my-new-favorite-oktoberfest-quote/",tags:"Y2009"},html:'<blockquote>It feels like a kegger at the psycho ward.</p></blockquote>\n<p>Wired on <a href="http://howto.wired.com/wiki/Oktoberfest_Etiquette">Oktoberfest Etiquette</a> (via <a href="http://bluelectric.org/2009/09/23/oktoberfest-etiquette/">bluelectric</a>)</p>'},next:{fields:{title:"Easy Morning for Free goes Nationwide",date:"20 Sep 2009",slug:"/2009-09-20-easy-morning-for-free-goes-nationwide/"}},previous:{fields:{title:"Easy Morning for Free: The Coupon",date:"26 Sep 2009",slug:"/2009-09-26-easy-morning-for-free-the-coupon/"}}},{node:{fields:{title:"Easy Morning for Free goes Nationwide",date:"20 Sep 2009",slug:"/2009-09-20-easy-morning-for-free-goes-nationwide/",tags:"Y2009"},html:'<p>When we did our <a href="http://www.papascott.de/archives/2008/10/11/easy-morning-for-free/">Easy Morning for Free</a> promotion in <a href="http://www.mcdonalds-nordheide.de/">our restaurant in Dibbersen</a> last year, we received a lot of positive response from within McDonald\'s wondering whether the idea could work on a larger scale. A similar promotion was done this spring when the new breakfast menu was introduced in Munich and Stuttgart. But wouldn\'t it be better yet if McDonald\'s could invite all of Germany to a free breakfast?</p>\n<p>Next Sunday, election day in Germany, that dream will come true. Next Saturday\'s <em>Bild Zeitung</em> and Sunday\'s <em>Bild am Sonntag</em> will carry coupons for a free breakfast (1 per person) at all participating McDonald\'s in Germany from 9 to 11 on Sunday. If you\'d rather not buy a paper, the coupons will be available online as well.</p>\n<p><a href="http://www.mcdonalds.de/produkte/easy_morning.html"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2009/09/wahlsonntag_karte1.jpg" alt="wahlsonntag_karte1.jpg" border="0" width="450" height="631" /></a></p>\n<p>The political choices may be pretty weak this year, however the McDonald\'s ballot offers a much wider variety of choices than the political ballot, No first and second votes, though, only one coupon per customer.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2009/09/wahlsonntag_karte2.jpg" alt="wahlsonntag_karte2.jpg" border="0" width="450" height="629" /></p>'},next:{fields:{title:'And the crowd goes "Yeaahh!"',date:"18 Sep 2009",slug:"/2009-09-18-and-the-crowd-goes-yeaahh/"}},previous:{fields:{title:"My New Favorite Oktoberfest Quote",date:"23 Sep 2009",slug:"/2009-09-23-my-new-favorite-oktoberfest-quote/"}}},{node:{fields:{title:'And the crowd goes "Yeaahh!"',date:"18 Sep 2009",slug:"/2009-09-18-and-the-crowd-goes-yeaahh/",tags:"Y2009"},html:'<p>It all started with with a poster for an Angela Merkel rally in Hamburg...</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2009/09/merkel-poster-yeaahh.jpg" alt="merkel-poster-yeaahh.jpg" border="0" width="499" height="374" /></p>\n<p>"The Chancellor is coming", and someone scribbled "and the crowd goes \'Yeaahh!\'" (or something to that effect). Someone else snapped a picture and <a href="http://www.flickr.com/photos/spanier/3910411907/">posted it to the internets</a> last week. A lot of people thought it was <a href="http://www.spreeblick.com/2009/09/15/und-alle-so-yeaahh/">cool</a>, and wouldn\'t it be cooler yet if the crowd would really go "Yeaahh!"</p>\n<p>So this evening there were about 500 people gathered at the rally who went "Yeaahh" at Merkel\'s every word.</p>\n<p><object classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=9,0,115,0" width="425" height="319" id="qikPlayer" align="middle"><param name="allowScriptAccess" value="always" /><param name="allowFullScreen" value="true" /><param name="movie" value="http://qik.com/swfs/qikPlayer4.swf" /><param name="quality" value="high" /><param name="bgcolor" value="#333333" /><param name="FlashVars" value="rssURL=http://qik.com/video/daf83ec4e280453eb960fcb254bbed0b.rss&autoPlay=false&polling=false" /><embed src="http://qik.com/swfs/qikPlayer4.swf" quality="high" bgcolor="#333333" width="425" height="319" name="qikPlayer" align="middle" allowscriptaccess="always" allowfullscreen="true" type="application/x-shockwave-flash" pluginspage="http://www.macromedia.com/go/getflashplayer" flashvars="rssURL=http://qik.com/video/daf83ec4e280453eb960fcb254bbed0b.rss&autoPlay=false&polling=false" /></object></p>\n<p>No, I wasn\'t there. I have a wife and son, I don\'t have time for nonsense like this. :-)</p>\n<p><strong>Update:</strong> The action <a href="http://www.spiegel.de/netzwelt/web/0,1518,650004,00.html">made it into Spiegel Online</a>, but they don\'t get it either.</p>'},next:{fields:{title:"Carpet Surfing",date:"13 Sep 2009",slug:"/2009-09-13-carpet-surfing/"}},previous:{fields:{title:"Easy Morning for Free goes Nationwide",date:"20 Sep 2009",slug:"/2009-09-20-easy-morning-for-free-goes-nationwide/"}}}],pathPrefix:"",first:!1,last:!1,index:50,pageCount:1101}}}});
